import React, {Component} from 'react';

class Photo extends Component{
    render(){
        const post = this.props.post;
        return(
            <figure class="figure">
                <img class="photo" src={post.imageLink} alt={post.description}></img>
                <figcaption>
                    <p>
                        {post.description}
                    </p>
                </figcaption>
            </figure>
        )
    }
}
export default Photo;
